import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { getUserFromStorage } from '../services/auth';

export default function Navbar() {
  const user = getUserFromStorage();
  const navigate = useNavigate();

  const logout = () => {
    localStorage.clear();
    navigate('/login');
  };

  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-primary shadow-sm">
      <div className="container">
        <Link className="navbar-brand fw-bold text-white" to="/">College Events</Link>
        <div className="collapse navbar-collapse">
          <ul className="navbar-nav ms-auto align-items-center">
            {user && user.role === 'Committee' && <li className="nav-item"><Link className="nav-link text-white" to="/committee/request">Request Event</Link></li>}
            {user && user.role === 'Committee' && <li className="nav-item"><Link className="nav-link text-white" to="/committee/upcoming">My Upcoming Events</Link></li>}
            {!user && <li className="nav-item"><Link className="nav-link text-white" to="/login">Login</Link></li>}
            {!user && <li className="nav-item"><Link className="nav-link text-white" to="/register">Register</Link></li>}
            {user && (
              <>
                <li className="nav-item"><Link className="nav-link text-white" to="/profile">{user.name}</Link></li>
                {user.role === 'Admin' && <li className="nav-item"><Link className="nav-link text-white" to="/admin">Dashboard</Link></li>}
                {user.role === 'Committee' && <li className="nav-item"><Link className="nav-link text-white" to="/committee">Dashboard</Link></li>}
                {user.role === 'User' && <li className="nav-item"><Link className="nav-link text-white" to="/user">Dashboard</Link></li>}
                <li className="nav-item ms-2"><button className="btn btn-sm btn-outline-light" onClick={logout}>Logout</button></li>
              </>
            )}
          </ul>
        </div>
      </div>
    </nav>
  );
}
